@testset "4.2.4.2 (a+b cos)^m (c+d cos)^n (A+B cos+C cos^2)" begin
    @variables A, B, C, a, b, c, d, m, x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*(d*cos(e+f*x))^m*(a+a*cos(e+f*x))^n*(A+B*cos(e+f*x)+C*cos(e+f*x)^2)=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(d*cos(e+f*x))^m*(a+a*cos(e+f*x))^n*(A+C*cos(e+f*x)^2)=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*cos(e+f*x)^m*(A+C*cos(e+f*x)^2)*(a+a*cos(e+f*x))^n=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [cos(c + d*x)^2*(a + a*cos(c + d*x))*(A + C*cos(c + d*x)^2), x, 7, (1/8)*a*(4*A + 3*C)*x + (a*(5*A + 4*C)*sin(c + d*x))/(5*d) + (a*(4*A + 3*C)*cos(c + d*x)*sin(c + d*x))/(8*d) + (a*C*cos(c + d*x)^3*sin(c + d*x))/(4*d) + (a*C*cos(c + d*x)^4*sin(c + d*x))/(5*d) - (a*(5*A + 4*C)*sin(c + d*x)^3)/(15*d)]
    @test_int [cos(c + d*x)*(a + a*cos(c + d*x))*(A + C*cos(c + d*x)^2), x, 3, (1/8)*a*(4*A + 3*C)*x + (a*(3*A + 2*C)*sin(c + d*x))/(3*d) + (a*(4*A + 3*C)*cos(c + d*x)*sin(c + d*x))/(8*d) + (a*C*cos(c + d*x)^2*sin(c + d*x))/(3*d) + (a*C*cos(c + d*x)^3*sin(c + d*x))/(4*d)]
    @test_int [(a + a*cos(c + d*x))*(A + C*cos(c + d*x)^2), x, 2, (a*(2*A + C)*x)/2 + (a*(3*A + C)*sin(c + d*x))/(3*d) - (a*C*cos(c + d*x)*sin(c + d*x))/(6*d) + (C*(a + a*cos(c + d*x))^2*sin(c + d*x))/(3*a*d)]
    @test_int [(a + a*cos(c + d*x))*(A + C*cos(c + d*x)^2)*sec(c + d*x), x, 4, (1/2)*a*(2*A + C)*x + (a*A*atanh(sin(c + d*x)))/d + (a*C*sin(c + d*x))/d + (a*C*cos(c + d*x)*sin(c + d*x))/(2*d)]
    @test_int [(a + a*cos(c + d*x))*(A + C*cos(c + d*x)^2)*sec(c + d*x)^2, x, 4, a*C*x + (a*A*atanh(sin(c + d*x)))/d + (a*C*sin(c + d*x))/d + (a*A*tan(c + d*x))/d]
    @test_int [(a + a*cos(c + d*x))*(A + C*cos(c + d*x)^2)*sec(c + d*x)^3, x, 4, a*C*x + (a*(A + 2*C)*atanh(sin(c + d*x)))/(2*d) + (a*A*tan(c + d*x))/d + (a*A*sec(c + d*x)*tan(c + d*x))/(2*d)]
    @test_int [(a + a*cos(c + d*x))*(A + C*cos(c + d*x)^2)*sec(c + d*x)^4, x, 6, (a*(A + 2*C)*atanh(sin(c + d*x)))/(2*d) + (a*(2*A + 3*C)*tan(c + d*x))/(3*d) + (a*A*sec(c + d*x)*tan(c + d*x))/(2*d) + (a*A*sec(c + d*x)^2*tan(c + d*x))/(3*d)]
    @test_int [(a + a*cos(c + d*x))*(A + C*cos(c + d*x)^2)*sec(c + d*x)^5, x, 7, (a*(3*A + 4*C)*atanh(sin(c + d*x)))/(8*d) + (a*(2*A + 3*C)*tan(c + d*x))/(3*d) + (a*(3*A + 4*C)*sec(c + d*x)*tan(c + d*x))/(8*d) + (a*A*sec(c + d*x)^2*tan(c + d*x))/(3*d) + (a*A*sec(c + d*x)^3*tan(c + d*x))/(4*d)]


    @test_int [cos(c + d*x)^2*(a + a*cos(c + d*x))^2*(A + C*cos(c + d*x)^2), x, 9, (1/16)*a^2*(14*A + 11*C)*x + (2*a^2*(5*A + 4*C)*sin(c + d*x))/(5*d) + (a^2*(14*A + 11*C)*cos(c + d*x)*sin(c + d*x))/(16*d) + (a^2*(10*A + 9*C)*cos(c + d*x)^3*sin(c + d*x))/(40*d) + (C*cos(c + d*x)^3*(a + a*cos(c + d*x))^2*sin(c + d*x))/(6*d) + (C*cos(c + d*x)^3*(a^2 + a^2*cos(c + d*x))*sin(c + d*x))/(15*d) - (2*a^2*(5*A + 4*C)*sin(c + d*x)^3)/(15*d)]
    @test_int [cos(c + d*x)^1*(a + a*cos(c + d*x))^2*(A + C*cos(c + d*x)^2), x, 5, (a^2*(4*A + 3*C)*x)/4 + (a^2*(4*A + 3*C)*sin(c + d*x))/(3*d) + (a^2*(4*A + 3*C)*cos(c + d*x)*sin(c + d*x))/(12*d) + ((10*A + 3*C)*(a + a*cos(c + d*x))^2*sin(c + d*x))/(30*d) + (C*cos(c + d*x)^2*(a + a*cos(c + d*x))^2*sin(c + d*x))/(5*d) + (C*(a + a*cos(c + d*x))^3*sin(c + d*x))/(10*a*d)]
    @test_int [cos(c + d*x)^0*(a + a*cos(c + d*x))^2*(A + C*cos(c + d*x)^2), x, 3, (a^2*(12*A + 7*C)*x)/8 + (a^2*(12*A + 7*C)*sin(c + d*x))/(6*d) + (a^2*(12*A + 7*C)*cos(c + d*x)*sin(c + d*x))/(24*d) - (C*(a + a*cos(c + d*x))^2*sin(c + d*x))/(12*d) + (C*(a + a*cos(c + d*x))^3*sin(c + d*x))/(4*a*d)]
    @test_int [(a + a*cos(c + d*x))^2*(A + C*cos(c + d*x)^2)*sec(c + d*x)^1, x, 6, a^2*(2*A + C)*x + (a^2*A*atanh(sin(c + d*x)))/d + (a^2*(A + C)*sin(c + d*x))/d + (C*(a + a*cos(c + d*x))^2*sin(c + d*x))/(3*d) + (C*(a^2 + a^2*cos(c + d*x))*sin(c + d*x))/(3*d)]
    @test_int [(a + a*cos(c + d*x))^2*(A + C*cos(c + d*x)^2)*sec(c + d*x)^2, x, 6, (a^2*(2*A + 3*C)*x)/2 + (2*a^2*A*atanh(sin(c + d*x)))/d - (a^2*(2*A - 3*C)*sin(c + d*x))/(2*d) - ((2*A - C)*(a^2 + a^2*cos(c + d*x))*sin(c + d*x))/(2*d) + (A*(a + a*cos(c + d*x))^2*tan(c + d*x))/d]
    @test_int [(a + a*cos(c + d*x))^2*(A + C*cos(c + d*x)^2)*sec(c + d*x)^3, x, 6, 2*a^2*C*x + (a^2*(3*A + 2*C)*atanh(sin(c + d*x)))/(2*d) - (a^2*(3*A - 2*C)*sin(c + d*x))/(2*d) + (A*(a^2 + a^2*cos(c + d*x))*tan(c + d*x))/d + (A*(a + a*cos(c + d*x))^2*sec(c + d*x)*tan(c + d*x))/(2*d)]
    @test_int [(a + a*cos(c + d*x))^2*(A + C*cos(c + d*x)^2)*sec(c + d*x)^4, x, 6, a^2*C*x + (a^2*(A + 2*C)*atanh(sin(c + d*x)))/d + (a^2*(A + C)*tan(c + d*x))/d + (A*(a^2 + a^2*cos(c + d*x))*sec(c + d*x)*tan(c + d*x))/(3*d) + (A*(a + a*cos(c + d*x))^2*sec(c + d*x)^2*tan(c + d*x))/(3*d)]
    @test_int [(a + a*cos(c + d*x))^2*(A + C*cos(c + d*x)^2)*sec(c + d*x)^5, x, 8, (a^2*(7*A + 12*C)*atanh(sin(c + d*x)))/(8*d) + (2*a^2*(2*A + 3*C)*tan(c + d*x))/(3*d) + (a^2*(11*A + 12*C)*sec(c + d*x)*tan(c + d*x))/(24*d) + (A*(a^2 + a^2*cos(c + d*x))*sec(c + d*x)^2*tan(c + d*x))/(6*d) + (A*(a + a*cos(c + d*x))^2*sec(c + d*x)^3*tan(c + d*x))/(4*d)]
    @test_int [(a + a*cos(c + d*x))^2*(A + C*cos(c + d*x)^2)*sec(c + d*x)^6, x, 9, (a^2*(3*A + 4*C)*atanh(sin(c + d*x)))/(4*d) + (a^2*(18*A + 25*C)*tan(c + d*x))/(15*d) + (a^2*(3*A + 4*C)*sec(c + d*x)*tan(c + d*x))/(4*d) + (a^2*(9*A + 10*C)*sec(c + d*x)^2*tan(c + d*x))/(30*d) + (A*(a^2 + a^2*cos(c + d*x))*sec(c + d*x)^3*tan(c + d*x))/(10*d) + (A*(a + a*cos(c + d*x))^2*sec(c + d*x)^4*tan(c + d*x))/(5*d)]


    @test_int [cos(c + d*x)^2*(a + a*cos(c + d*x))^3*(A + C*cos(c + d*x)^2), x, 10, (1/16)*a^3*(26*A + 21*C)*x + (a^3*(133*A + 108*C)*sin(c + d*x))/(35*d) + (a^3*(26*A + 21*C)*cos(c + d*x)*sin(c + d*x))/(16*d) + (a^3*(154*A + 129*C)*cos(c + d*x)^3*sin(c + d*x))/(280*d) + (C*cos(c + d*x)^3*(a + a*cos(c + d*x))^3*sin(c + d*x))/(7*d) + (C*cos(c + d*x)^3*(a^2 + a^2*cos(c + d*x))^2*sin(c + d*x))/(14*a*d) + ((A + C)*cos(c + d*x)^3*(a^3 + a^3*cos(c + d*x))*sin(c + d*x))/(5*d) - (a^3*(133*A + 108*C)*sin(c + d*x)^3)/(105*d)]
    @test_int [cos(c + d*x)^1*(a + a*cos(c + d*x))^3*(A + C*cos(c + d*x)^2), x, 11, (1/16)*a^3*(30*A + 23*C)*x + (a^3*(30*A + 23*C)*sin(c + d*x))/(10*d) + (3*a^3*(30*A + 23*C)*cos(c + d*x)*sin(c + d*x))/(80*d) + ((30*A + 7*C)*(a + a*cos(c + d*x))^3*sin(c + d*x))/(120*d) + (C*cos(c + d*x)^2*(a + a*cos(c + d*x))^3*sin(c + d*x))/(6*d) + (C*(a + a*cos(c + d*x))^4*sin(c + d*x))/(10*a*d) - (a^3*(30*A + 23*C)*sin(c + d*x)^3)/(120*d)]
    @test_int [cos(c + d*x)^0*(a + a*cos(c + d*x))^3*(A + C*cos(c + d*x)^2), x, 9, (1/8)*a^3*(20*A + 13*C)*x + (a^3*(20*A + 13*C)*sin(c + d*x))/(5*d) + (3*a^3*(20*A + 13*C)*cos(c + d*x)*sin(c + d*x))/(40*d) - (C*(a + a*cos(c + d*x))^3*sin(c + d*x))/(20*d) + (C*(a + a*cos(c + d*x))^4*sin(c + d*x))/(5*a*d) - (a^3*(20*A + 13*C)*sin(c + d*x)^3)/(60*d)]
    @test_int [(a + a*cos(c + d*x))^3*(A + C*cos(c + d*x)^2)*sec(c + d*x)^1, x, 7, (a^3*(28*A + 15*C)*x)/8 + (a^3*A*atanh(sin(c + d*x)))/d + (5*a^3*(4*A + 3*C)*sin(c + d*x))/(8*d) + (C*(a + a*cos(c + d*x))^3*sin(c + d*x))/(4*d) + (C*(a^2 + a^2*cos(c + d*x))^2*sin(c + d*x))/(4*a*d) + ((4*A + 5*C)*(a^3 + a^3*cos(c + d*x))*sin(c + d*x))/(8*d)]
    @test_int [(a + a*cos(c + d*x))^3*(A + C*cos(c + d*x)^2)*sec(c + d*x)^2, x, 7, (a^3*(6*A + 5*C)*x)/2 + (3*a^3*A*atanh(sin(c + d*x)))/d + (5*a^3*C*sin(c + d*x))/(2*d) - ((3*A - C)*(a^2 + a^2*cos(c + d*x))^2*sin(c + d*x))/(3*a*d) - ((6*A - 5*C)*(a^3 + a^3*cos(c + d*x))*sin(c + d*x))/(6*d) + (A*(a + a*cos(c + d*x))^3*tan(c + d*x))/d]
    @test_int [(a + a*cos(c + d*x))^3*(A + C*cos(c + d*x)^2)*sec(c + d*x)^3, x, 7, (a^3*(2*A + 7*C)*x)/2 + (a^3*(7*A + 2*C)*atanh(sin(c + d*x)))/(2*d) - (5*a^3*(A - C)*sin(c + d*x))/(2*d) - ((4*A - C)*(a^3 + a^3*cos(c + d*x))*sin(c + d*x))/(2*d) + (3*A*(a^2 + a^2*cos(c + d*x))^2*tan(c + d*x))/(2*a*d) + (A*(a + a*cos(c + d*x))^3*sec(c + d*x)*tan(c + d*x))/(2*d)]
    @test_int [(a + a*cos(c + d*x))^3*(A + C*cos(c + d*x)^2)*sec(c + d*x)^4, x, 7, 3*a^3*C*x + (a^3*(5*A + 6*C)*atanh(sin(c + d*x)))/(2*d) - (5*a^3*A*sin(c + d*x))/(2*d) + ((5*A + 3*C)*(a^3 + a^3*cos(c + d*x))*tan(c + d*x))/(3*d) + (A*(a^2 + a^2*cos(c + d*x))^2*sec(c + d*x)*tan(c + d*x))/(2*a*d) + (A*(a + a*cos(c + d*x))^3*sec(c + d*x)^2*tan(c + d*x))/(3*d)]
    @test_int [(a + a*cos(c + d*x))^3*(A + C*cos(c + d*x)^2)*sec(c + d*x)^5, x, 7, a^3*C*x + (a^3*(15*A + 28*C)*atanh(sin(c + d*x)))/(8*d) + (5*a^3*(3*A + 4*C)*tan(c + d*x))/(8*d) + ((5*A + 4*C)*(a^3 + a^3*cos(c + d*x))*sec(c + d*x)*tan(c + d*x))/(8*d) + (A*(a^2 + a^2*cos(c + d*x))^2*sec(c + d*x)^2*tan(c + d*x))/(4*a*d) + (A*(a + a*cos(c + d*x))^3*sec(c + d*x)^3*tan(c + d*x))/(4*d)]
    @test_int [(a + a*cos(c + d*x))^3*(A + C*cos(c + d*x)^2)*sec(c + d*x)^6, x, 9, (a^3*(13*A + 20*C)*atanh(sin(c + d*x)))/(8*d) + (a^3*(38*A + 55*C)*tan(c + d*x))/(15*d) + (a^3*(109*A + 140*C)*sec(c + d*x)*tan(c + d*x))/(120*d) + ((11*A + 10*C)*(a^3 + a^3*cos(c + d*x))*sec(c + d*x)^2*tan(c + d*x))/(30*d) + (3*A*(a^2 + a^2*cos(c + d*x))^2*sec(c + d*x)^3*tan(c + d*x))/(20*a*d) + (A*(a + a*cos(c + d*x))^3*sec(c + d*x)^4*tan(c + d*x))/(5*d)]
    @test_int [(a + a*cos(c + d*x))^3*(A + C*cos(c + d*x)^2)*sec(c + d*x)^7, x, 10, (a^3*(23*A + 30*C)*atanh(sin(c + d*x)))/(16*d) + (a^3*(34*A + 45*C)*tan(c + d*x))/(15*d) + (a^3*(23*A + 30*C)*sec(c + d*x)*tan(c + d*x))/(16*d) + (a^3*(73*A + 90*C)*sec(c + d*x)^2*tan(c + d*x))/(120*d) + ((31*A + 30*C)*(a^3 + a^3*cos(c + d*x))*sec(c + d*x)^3*tan(c + d*x))/(120*d) + (A*(a^2 + a^2*cos(c + d*x))^2*sec(c + d*x)^4*tan(c + d*x))/(10*a*d) + (A*(a + a*cos(c + d*x))^3*sec(c + d*x)^5*tan(c + d*x))/(6*d)]


    @test_int [cos(c + d*x)^2*(a + a*cos(c + d*x))^4*(A + C*cos(c + d*x)^2), x, 11, (1/128)*a^4*(392*A + 323*C)*x + (4*a^4*(63*A + 52*C)*sin(c + d*x))/(35*d) + (a^4*(392*A + 323*C)*cos(c + d*x)*sin(c + d*x))/(128*d) + (a^4*(2408*A + 2007*C)*cos(c + d*x)^3*sin(c + d*x))/(2240*d) + (a*C*cos(c + d*x)^3*(a + a*cos(c + d*x))^3*sin(c + d*x))/(14*d) + (C*cos(c + d*x)^3*(a + a*cos(c + d*x))^4*sin(c + d*x))/(8*d) + ((56*A + 61*C)*cos(c + d*x)^3*(a^2 + a^2*cos(c + d*x))^2*sin(c + d*x))/(336*d) + (7*(8*A + 7*C)*cos(c + d*x)^3*(a^4 + a^4*cos(c + d*x))*sin(c + d*x))/(120*d) - (4*a^4*(63*A + 52*C)*sin(c + d*x)^3)/(105*d)]
    @test_int [cos(c + d*x)^1*(a + a*cos(c + d*x))^4*(A + C*cos(c + d*x)^2), x, 14, (1/4)*a^4*(14*A + 11*C)*x + (16*a^4*(14*A + 11*C)*sin(c + d*x))/(35*d) + (27*a^4*(14*A + 11*C)*cos(c + d*x)*sin(c + d*x))/(140*d) + (a^4*(14*A + 11*C)*cos(c + d*x)^3*sin(c + d*x))/(70*d) + ((21*A + 4*C)*(a + a*cos(c + d*x))^4*sin(c + d*x))/(105*d) + (C*cos(c + d*x)^2*(a + a*cos(c + d*x))^4*sin(c + d*x))/(7*d) + (2*C*(a + a*cos(c + d*x))^5*sin(c + d*x))/(21*a*d) - (8*a^4*(14*A + 11*C)*sin(c + d*x)^3)/(105*d)]
    @test_int [cos(c + d*x)^0*(a + a*cos(c + d*x))^4*(A + C*cos(c + d*x)^2), x, 12, (7/16)*a^4*(10*A + 7*C)*x + (4*a^4*(10*A + 7*C)*sin(c + d*x))/(5*d) + (27*a^4*(10*A + 7*C)*cos(c + d*x)*sin(c + d*x))/(80*d) + (a^4*(10*A + 7*C)*cos(c + d*x)^3*sin(c + d*x))/(40*d) - (C*(a + a*cos(c + d*x))^4*sin(c + d*x))/(30*d) + (C*(a + a*cos(c + d*x))^5*sin(c + d*x))/(6*a*d) - (2*a^4*(10*A + 7*C)*sin(c + d*x)^3)/(15*d)]
    @test_int [(a + a*cos(c + d*x))^4*(A + C*cos(c + d*x)^2)*sec(c + d*x)^1, x, 8, (a^4*(12*A + 7*C)*x)/2 + (a^4*A*atanh(sin(c + d*x)))/d + (a^4*(10*A + 7*C)*sin(c + d*x))/(2*d) + (a*C*(a + a*cos(c + d*x))^3*sin(c + d*x))/(5*d) + (C*(a + a*cos(c + d*x))^4*sin(c + d*x))/(5*d) + ((5*A + 7*C)*(a^2 + a^2*cos(c + d*x))^2*sin(c + d*x))/(15*d) + ((8*A + 7*C)*(a^4 + a^4*cos(c + d*x))*sin(c + d*x))/(6*d)]
    @test_int [(a + a*cos(c + d*x))^4*(A + C*cos(c + d*x)^2)*sec(c + d*x)^2, x, 8, (a^4*(52*A + 35*C)*x)/8 + (4*a^4*A*atanh(sin(c + d*x)))/d + (5*a^4*(4*A + 7*C)*sin(c + d*x))/(8*d) - (a*(4*A - C)*(a + a*cos(c + d*x))^3*sin(c + d*x))/(4*d) - ((12*A - 7*C)*(a^2 + a^2*cos(c + d*x))^2*sin(c + d*x))/(12*d) - ((12*A - 35*C)*(a^4 + a^4*cos(c + d*x))*sin(c + d*x))/(24*d) + (A*(a + a*cos(c + d*x))^4*tan(c + d*x))/d]
